import logo from './logo.svg';
import './App.css';
import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("https://www.binance.com/bapi/nft/v1/public/nft/product-list", {
      "headers": {
        "accept": "*/*",
        "accept-language": "it-IT,it;q=0.9,en-US;q=0.8,en;q=0.7",
        "bnc-uuid": "8f4fb583-8175-4258-ac46-159f30f01411",
        "clienttype": "web",
        "content-type": "application/json",
        "csrftoken": "d41d8cd98f00b204e9800998ecf8427e",
        "device-info": "",
        "fvideo-id": "3136771bac4babbe9b571f7c39bbab26e305dd80",
        "lang": "en",
        "sec-fetch-dest": "empty",
        "sec-fetch-mode": "cors",
        "sec-fetch-site": "same-origin",
        "sec-gpc": "1",
        "x-trace-id": "628d832a-f923-4eb1-851c-717006c7ddaf",
        "x-ui-request-trace": "628d832a-f923-4eb1-851c-717006c7ddaf",
        "cookie": "cid=forA6zjn; bnc-uuid=8f4fb583-8175-4258-ac46-159f30f01411; source=organic; campaign=www.google.com; fiat-prefer-currency=EUR; nft-init-compliance=true; home-ui-ab=B; isAccountsLoggedIn=y; lang=it; userPreferredCurrency=EUR_USD; BNC_FV_KEY=3136771bac4babbe9b571f7c39bbab26e305dd80; BNC_FV_KEY_EXPIRE=1627549151381; sensorsdata2015jssdkcross=%7B%22distinct_id%22%3A%2272530447%22%2C%22first_id%22%3A%221775a1b52a7957-06b8150f14079a-6915227c-2621440-1775a1b52a9b92%22%2C%22props%22%3A%7B%22%24latest_traffic_source_type%22%3A%22%E7%9B%B4%E6%8E%A5%E6%B5%81%E9%87%8F%22%2C%22%24latest_search_keyword%22%3A%22%E6%9C%AA%E5%8F%96%E5%88%B0%E5%80%BC_%E7%9B%B4%E6%8E%A5%E6%89%93%E5%BC%80%22%2C%22%24latest_referrer%22%3A%22%22%7D%2C%22%24device_id%22%3A%221775a1b52a7957-06b8150f14079a-6915227c-2621440-1775a1b52a9b92%22%7D"
      },
      "referrer": "https://www.binance.com/en/nft/market",
      "referrerPolicy": "origin-when-cross-origin",
      "body": "{\"category\":0,\"keyword\":\"\",\"orderBy\":\"list_time\",\"orderType\":-1,\"page\":1,\"rows\":100}",
      "method": "POST",
      "mode": "cors"
    })
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.data.rows
          });
        },
        // Nota: Ã¨ importante gestire gli errori qui
        // invece di un blocco catch() in modo da non fare passare
        // eccezioni da bug reali nei componenti.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div style={{ height: 400, width: "100%" }}>
          <DataGrid
            rows={rows}
            columns={columns}
            pageSize={5}
            checkboxSelection
            disableSelectionOnClick
          />
        </div>
      /*
      return (
        <table className="tabella">
          <tr>
            <th>ID</th>
            <th>Prezzo</th>
            <th>Valuta</th>
            <th>URL</th>
          </tr>
          {items.map(item => (
            <tr key={item.productId}>
              <td>
                {item.productId}
              </td>
              <td className="price">
                {item.amount}
              </td>
              <td>
                {item.currency}
              </td>
              <td className="url">
                https://www.binance.com/en/nft/goods/blindBox/detail?productId={item.productId}&isProduct=1
              </td>
            </tr>
          ))}
        </table>*/
      );
    }
  }
}

export { App };

